import React, { Component } from 'react'

class Login extends Component {
  state = {
    email:'',
    password:''
  }

  render() {
    return (
      <div>
        <h2>Login</h2>
        <input
          type="email"
          placeholder='Email'
        />

        <input
          type="password"
          placeholder='Password'
        />

        <button
          type='button'
        >
          Entrar
        </button>
      </div>
    )
  }
}

export default Login;
